import axios from 'axios';

export async function get_my_ip() {
    try {
        const my_ip = await 
            axios.get('https://api.ipify.org')
                .then(
                function(){
                    console.log(my_ip.data);
                    return my_ip.data;
                }
        )
    } catch (error) {
        console.error(error);
        return 0;
    }
}
